import React, { useEffect, useState } from "react";
import {
  FaHeartbeat,
  FaBrain,
  FaBone,
  FaPhone,
  FaHospital,
  FaSun,
  FaMoon,
} from "react-icons/fa";
import { MdTipsAndUpdates } from "react-icons/md";
import { useNavigate } from "react-router-dom";
import "../index.css";

const Dashboard = () => {
  const navigate = useNavigate();
  const [darkMode, setDarkMode] = useState(
    localStorage.getItem("theme") === "dark"
  );

  useEffect(() => {
    document.documentElement.classList.toggle("dark", darkMode);
    localStorage.setItem("theme", darkMode ? "dark" : "light");
  }, [darkMode]);

  const exerciseCards = [
    {
      title: "Cardiac Rehab",
      icon: <FaHeartbeat size={24} className="text-red-600" />,
      label: "Heart Health",
      exercises: ["Step-Ups", "Chair Marching", "Leg Extensions"],
      link: "/exercise/cardiac",
      button: "Start",
    },
    {
      title: "Neuro Rehab",
      icon: <FaBrain size={24} className="text-purple-600" />,
      label: "Neurological Recovery",
      exercises: ["Balance Training", "Gait Training", "Coordination"],
      link: "/exercise/neuro",
      button: "Start",
    },
    {
      title: "Orthopedic Rehab",
      icon: <FaBone size={24} className="text-blue-700" />,
      label: "Bone & Joint Recovery",
      exercises: ["Chair Squats", "Leg Raise", "Shoulder Rolls"],
      link: "/exercise/ortho",
      button: "Start",
    },
    {
      title: "Physiotherapy Tips",
      icon: <MdTipsAndUpdates size={24} className="text-amber-500" />,
      label: "Guidance",
      exercises: ["Hydration", "Proper Form", "Rest"],
      link: "/exercise/physio",
      button: "Start",
    },
    {
      title: "Contact Us",
      icon: <FaPhone size={24} className="text-green-600" />,
      label: "Support",
      exercises: ["We care a lot about you."],
      link: "/contact",
      button: "Know More",
    },
    {
      title: "Best Rehab Center",
      icon: <FaHospital size={24} className="text-gray-600" />,
      label: "Nearby Help",
      exercises: ["Find the closest near me."],
      link: "/centers",
      button: "Find",
    },
  ];

  return (
    <div className="min-h-screen bg-gray-100 dark:bg-gray-900 transition-colors duration-300">
      {/* Header */}
      <header className="bg-blue-800 dark:bg-gray-800 text-white px-6 py-4 flex justify-between items-center shadow-md">
        <h1 className="text-2xl font-semibold">AI Rehab Dashboard</h1>
        <div className="flex items-center space-x-4">
          <nav className="space-x-6 hidden sm:block">
            <a href="/home" className="hover:underline">Home</a>
            <a href="/profile" className="hover:underline">Profile</a>
            <a href="/logout" className="hover:underline">Logout</a>
          </nav>
          <button
            className="focus:outline-none"
            onClick={() => setDarkMode(!darkMode)}
            title="Toggle dark mode"
          >
            {darkMode ? <FaSun size={20} /> : <FaMoon size={20} />}
          </button>
        </div>
      </header>

      {/* Cards */}
      <main className="p-6 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6">
        {exerciseCards.map((card, index) => (
          <div
            key={index}
            className="bg-white dark:bg-gray-800 text-gray-800 dark:text-white rounded-xl shadow-md hover:shadow-xl p-5 transition-transform duration-300 transform hover:scale-105 flex flex-col justify-between"
          >
            <div className="flex items-center gap-3 mb-2">
              {card.icon}
              <h2 className="text-lg font-semibold">{card.title}</h2>
            </div>
            <span className="inline-block text-xs font-semibold px-3 py-1 rounded-full bg-yellow-400 text-black mb-3 shadow-sm">
              {card.label}
            </span>
            <ul className="mb-4 list-disc list-inside text-sm">
              {card.exercises.map((ex, i) => (
                <li key={i}>{ex}</li>
              ))}
            </ul>
            <button
              className="mt-auto bg-blue-900 hover:bg-blue-700 text-white px-4 py-2 rounded transition-colors"
              onClick={() => navigate(card.link)}
            >
              {card.button}
            </button>
          </div>
        ))}
      </main>
    </div>
  );
};

export default Dashboard;
